import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Pixelify } from "react-pixelify";

const src = require("./image.png");

class MyImg extends React.Component {
  render() {
    return (
      <Pixelify
        src={src}
        width={250}
        height={250}
        centered={true}
        pixelSize={5}
      />
    );
  }
}


// ======================================
ReactDOM.render(
  <MyImg />,
  document.getElementById('root')
);
